import React, {Suspense} from 'react';
import { Route, Switch } from 'react-router-dom';

import WhatWeDo from './container/WhatWeDo/WhatWeDo';
import Layout from './container/Layout/Layout';
import * as actions from './store/action/index';

const AboutUs = React.lazy(() => {
  return import('./container/AboutUs/AboutUs');
});
const Innovation = React.lazy(() => {
  return import('./container/Innovation/Innovation');
});
const OurWork = React.lazy(() => {
  return import('./container/OurWork/OurWork');
});

const  app = (props) => {

    let route = <Switch>
                   <Route path="/" exact component={WhatWeDo} />
                   <Redirect to="/" />
                </Switch>


    return (
      <div>
         <Layout>
              <Suspense fallback={<p>Loading...</p>}>{route}</Suspense>
         </Layout>

      </div>
    );
}

export default app;
